import React from 'react';
const About = () => {
  return (
    <div id='about' className='about_me'>
      <div className='container py-5'>
        <h2>
          <span className='about'>About</span> Me
        </h2>
        <p>
        Hello Krishna Sai Surendra Kalluri, a talented Front End Engineer with a passion for building cutting-edge web and mobile applications using React.js and React-Native frameworks. With an extensive knowledge of HTML5, CSS3, JavaScript, React/Redux, Redux Saga, ES6, jQuery, Bootstrap, NodeJS, Styled Components, SASS/LESS CSS Preprocessors, and RESTful web services, Krishna is a versatile and skilled professional who has proven his expertise time and again.
        </p>
        <br />
        <p>
          I am really fond of building constructive and efficient solutions. I
          think open-mindedness may assist you to be creative and get insight
          into any subject in your area!
        </p>
      </div>
    </div>
  );
};

export default About;
